    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1609193699348,"commentText":"<div>This program shows a couple of variations of the loop. First, I show that the loop counter can count down instead of up. Next, I show that you can add more than one to the loop counter. Finally, I show that not all loops are count controlled.</div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-227":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-227","timestamp":1504719597650,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":227,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-226","lineNumber":14,"column":7,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608150826698,"commentText":"Not all loops need to start at 1. This is a loop that has a counter but it starts at 5.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"int count = 5;","startRow":6,"startColumn":4,"endRow":6,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"7","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 5; \n \n    while(count >= 1) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        count--; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-2","displayCommentEvent":{"id":"ev-227","timestamp":1504719597650,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":227,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-226","lineNumber":14,"column":7,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608151008825,"commentText":"<div>The loop test checks whether the counter is greater than or equal to 1. This will be <font face=\"Courier\">true</font> until the counter decreases to 1.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"while(count >= 1)","startRow":8,"startColumn":4,"endRow":8,"endColumn":21}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"5","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 5; \n \n    while(count >= 1) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        count--; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-3","displayCommentEvent":{"id":"ev-227","timestamp":1504719597650,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":227,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-226","lineNumber":14,"column":7,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608151080240,"commentText":"This code decreases the counter by 1 making the loop test eventually evaluate to false (after printing my name 5 times).<div><br></div><div>The <font face=\"Courier\">--</font> is the decrement operator that subtracts one from an integer.</div><div><br></div><div>Take a moment to draw the variable in memory and trace through how this \ncode will run. This is a skill that every programmer needs to get good \nat!</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"count--;","startRow":12,"startColumn":8,"endRow":12,"endColumn":16}],"imageURLs":["media/images/1608151057440-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"1","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 5; \n \n    while(count >= 1) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        count--; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-4","displayCommentEvent":{"id":"ev-227","timestamp":1504719597650,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":227,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-226","lineNumber":14,"column":7,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609194058660,"commentText":"If you forget to update the loop counter some strange things can happen. Imagine line 13 is left out. In other words, the value of count never decreases (or changes at all). What would happen? The computer would happily loop forever printing out my name because the value inside count is always 5. Since it never changes the loop test will always be <font face=\"Courier\">true</font>, 5 &gt;= 1. The screen shot shows what the program looked like after a few seconds of running.<div><br></div><div>It is likely that you will accidentally create one of these 'infinite loops'. Most systems allow you to kill a command line program with <font face=\"Courier\">Ctrl + C</font> or <font face=\"Courier\">Ctrl + D</font>.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"count--;","startRow":12,"startColumn":8,"endRow":12,"endColumn":16}],"imageURLs":["media/images/1608151160416-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"1","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 5; \n \n    while(count >= 1) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        count--; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-244":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-244","timestamp":1504719786583,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":244,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-243","lineNumber":11,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609194080885,"commentText":"There is nothing particularly special about the counter variable. It can be used inside the loop like any other variable. Here I am using it in the print statement to show what the current value of the counter is (see the attached screenshot).","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"count","startRow":6,"startColumn":8,"endRow":6,"endColumn":13},{"fileId":"fileId-0","selectedText":"count","startRow":10,"startColumn":14,"endRow":10,"endColumn":19}],"imageURLs":["media/images/1608151294736-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 5; \n \n    while(count >= 1) \n    { \n        cout<<count<<\". Mark Mahoney\"<<endl; \n \n        count--; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-274":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-274","timestamp":1504719860779,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":274,"type":"INSERT","fileId":"fileId-0","character":"0","previousNeighborId":"ev-273","lineNumber":13,"column":26,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608151489521,"commentText":"The loop counter can be increased/decreased by a value other than 1. Here I am adding 10 to the counter each iteration of the loop (see the attached screenshot).<br><br>Take a moment to draw the variable in this program and trace through the different values that it will hold as the loop iterates.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"int count = 10;","startRow":6,"startColumn":4,"endRow":6,"endColumn":19},{"fileId":"fileId-0","selectedText":"count <= 100","startRow":8,"startColumn":10,"endRow":8,"endColumn":22},{"fileId":"fileId-0","selectedText":"count = count + 10;","startRow":12,"startColumn":8,"endRow":12,"endColumn":27}],"imageURLs":["media/images/1608151468231-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    int count = 10; \n \n    while(count <= 100) \n    { \n        cout<<count<<\". Mark Mahoney\"<<endl; \n \n        count = count + 10; \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-592":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-592","timestamp":1504720004294,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":592,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-591","lineNumber":19,"column":27,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609194656304,"commentText":"Not all loops are 'count-controlled'. This is a loop that uses the value of a boolean variable to control it (the initial value of the boolean is <font face=\"Courier\">false</font>).<div><br></div><div>All that is required is that a logical expression that evaluates to <font face=\"Courier\">true</font> or <font face=\"Courier\">false</font> be put inside the loop test. Notice here I am using the 'not' operator (!) to negate the value of the boolean variable. I would read this as, \"while not done yet.\"<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"while(!doneYet)","startRow":9,"startColumn":4,"endRow":9,"endColumn":19}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"11","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    bool doneYet = false; \n    char response; \n \n    while(!doneYet) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        cout<<\"Are you done yet (y or n)? \"; \n        cin>>response; \n \n        if(response == 'y') \n        { \n            doneYet = true; \n        } \n    } ","commentTags":[],"questionCommentData":{"allAnswers":["Mark Mahoney Are you done yet (y or n)?","Mark Mahoney","There would be no output"],"correctAnswer":"There would be no output","question":"What would the program output be if I initialized the variable doneYet to true?"}},{"id":"commentId-8","displayCommentEvent":{"id":"ev-592","timestamp":1504720004294,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":592,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-591","lineNumber":19,"column":27,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608151696255,"commentText":"<div>The flow of control always returns to the loop test after the body has been fully executed. The conditional expression is then evaluated to determine if the loop body should be executed again.</div><div><br></div><div>As long as that boolean variable gets a new value at some point during the loop, this is a valid 'event-controlled' loop.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<\"Are you done yet (y or n)? \"; \n        cin>>response; \n \n        if(response == 'y') \n        { \n            doneYet = true; \n        }","startRow":13,"startColumn":8,"endRow":19,"endColumn":9}],"imageURLs":["media/images/1608151649726-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"1","currentFilePath":"/moreLoops.cpp","viewableBlogText":"    while(!doneYet) \n    { \n        cout<<\"Mark Mahoney\"<<endl; \n \n        cout<<\"Are you done yet (y or n)? \"; \n        cin>>response; \n \n        if(response == 'y') \n        { \n            doneYet = true; \n        } \n    } ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
